import React from 'react';
import './Cassette.css';

const Cassette = () => {
return (
<div className="cassette-container">
    <div className="cassette">
        <div className="cassette-top-stripe"></div>
        <div className="cassette-middle">
            <div className="cassette-wheel">
            <div className="cassette-wheel-inner"></div>
        </div>
        <div className="cassette-label"></div>
        <div className="cassette-wheel">
            <div className="cassette-wheel-inner"></div>
        </div>
        </div>
        <div className="cassette-bottom-stripe"></div>
    </div>
</div>
);
};

export default Cassette;
